%[text] ## Basal Resampling Illustration
%[text] This script illustrates basal rate resampling in different scenarios.
%   Author: Jan Wrede
%   Date: 2025-10-22
%   
%   This file is part of the larger AIDIF-toolbox project and is licensed 
%       under the MIT license. A copy of the MIT License can be found in 
%       the project's root directory.
%
%   Copyright (c) 2025, AIDIF
%   All rights reserved
%%
%[text] **Scenario 1**: Perfectly aligned to 5 minute intervals, Fixed Rate
start = datetime("today");
timestamps = datetime("today"):minutes(30):start+minutes(60);
basalRate = ones(size(timestamps)); 
basalRate = timetable(timestamps', basalRate', 'VariableNames', {'basal_rate'});
resampleAndDraw(basalRate); %[output:29b17470]
title("Scenario 1: Perfectly aligned, Fixed Rate") %[output:29b17470]
%%
%[text] **Scenario 2**: Perfectly aligned to 5 minute intervals, Change from 0 to 1 back to zero.
timestamps = datetime("today"):minutes(60):start+hours(4);
basalRate = ones(size(timestamps)); basalRate(1:2:length(basalRate))=0;
basalRate = timetable(timestamps', basalRate', 'VariableNames', {'basal_rate'});
resampleAndDraw(basalRate) %[output:11864789]
title("Scenario 2: Perfectly aligned, Rate Changes 0-1-0") %[output:11864789]
%%
%[text] **Scenario 3**: Not Perfectly aligned, Fixed basal rate (1U/h) 
%[text] For the first sample, delivery happend for1 minute (1/60), for the last sample, delivery stops after 4 minutes (4/60)
timestamps = datetime("today") + [minutes(4),minutes(64)];
basalRate = [1,0];
basalRate = timetable(timestamps', basalRate', 'VariableNames', {'basal_rate'});
resampleAndDraw(basalRate); %[output:12a61ee0]
title("Scenario 3: Not Perfectly aligned, 1 U/h"); %[output:12a61ee0]

%%
%[text] **Scenario 4**: Not perfectly aligned, and multiple values within 5 minutes
%[text] 1 minute delivery of 1U/h + 1 minute delivery of 2U/h = 3/60 = 0.5U
timestamps = datetime("today") + minutes([0,3,4,5]);
basalRate = [0,1,2,0];
basalRate = timetable(timestamps', basalRate', 'VariableNames', {'basal_rate'});
resampleAndDraw(basalRate); %[output:8f9f3450]
title("Scenario 4: Multiple rates within 5 minutes"); %[output:8f9f3450]
%%
function resampleAndDraw(tt)
    %resample
    ttResampled = AIDIF.interpolateBasal(tt);
    
    %draw irregular basal rates
    clf; hold on; 
    [xs, ys] = stairs(tt.Time, tt.basal_rate);
    area(xs ,ys ,'FaceAlpha', 0.3, 'EdgeColor', 'none','FaceColor','blue',DisplayName='Basal Rate');
    ylim([0, max(tt.basal_rate) + 0.1]);
    %legend()
    ylabel('U/h')

    %draw regular (resampled) basal rate equivalent insulin deliveries
    yyaxis('right')
    stem(ttResampled,"Time","InsulinDelivery",Color='yellow',Marker='.',MarkerSize=10,DisplayName='Insulin Delivery')
    valid = AIDIF.findGaps(tt,ttResampled,2);
    isequal(tt.Time, ttResampled.Time); %sanity check
    ttResampled.valid = valid.valid;
    ylabel('U')
    
    % Mark NaNs (just for debuggin)
    nan_indices = isnan(ttResampled.InsulinDelivery);
    scatter(ttResampled.Time(nan_indices), zeros(sum(nan_indices),1), 'filled', 'x', 'MarkerEdgeColor', 'red', DisplayName='NaN');
    
    ylim([0,5/60 *1.2]);
    hold off;
    xlim([min(tt.Time)-minutes(10), max(tt.Time)+minutes(10)])
    legend()
end

